// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract Todo {
    
    struct Task {
        uint id;
        string content;
        bool completed;
    }

    address public owner;
    uint public taskCount;

    mapping(uint => Task) public tasks;

    modifier onlyOwner() {
        require(msg.sender == owner, "ToDo : Caller is not the Owner");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    event TaskCreated(uint indexed id, string content, bool completed);
    event TaskToggled(uint indexed id, bool completed);
    event TaskContentUpdated(uint indexed id, string newContent);
    event TaskDeleted(uint indexed id);

    function createTask(string calldata _content) external onlyOwner {
        require(bytes(_content).length > 0, "ToDo : Content cannot be empty");

        taskCount++;
        uint newTaskId = taskCount;
        tasks[newTaskId] = Task(newTaskId, _content, false);

        emit TaskCreated(newTaskId, _content, false);
    }

    function toggleCompleted(uint _id) external onlyOwner {
        require(tasks[_id].id  != 0, "ToDo : Task does not exist ! ");

        Task storage taskToToggle = tasks[_id];
        taskToToggle.completed = !taskToToggle.completed;

        emit TaskToggled(_id, taskToToggle.completed);
    }

    function updatedTask(uint _id, string calldata _newContent) external onlyOwner {
        require(tasks[_id].id  != 0, "ToDo : Task does not exist ! ");
        require(bytes(_newContent).length > 0, "ToDo : Content cannot be empty");

        tasks[_id].content = _newContent;

        emit TaskContentUpdated(_id, _newContent);
    }

    function deleteTask(uint _id) external onlyOwner {
        require(tasks[_id].id  != 0, "ToDo : Task does not exist ! ");

        delete tasks[_id];

        emit TaskDeleted(_id);
    }

    function getTask(uint _id) external view returns(uint, string memory, bool) {
        require(tasks[_id].id  != 0, "ToDo : Task does not exist ! ");

        Task storage _task = tasks[_id];

        return (_task.id, _task.content, _task.completed);
    }

    function getAllTasks() external view returns(Task[] memory) {
        uint activeTaskCount = 0;
        for(uint i = 1; i <= taskCount; i++) {
            if(tasks[i].id != 0) {
                activeTaskCount++;
            }
        }

        if(activeTaskCount == 0) {
            return new Task[](0);
        }

        Task[] memory allTasks = new Task[](activeTaskCount);
        uint currentIndex = 0;
        for(uint i = 1; i <= taskCount; i++) {
            if(tasks[i].id != 0) {
                allTasks[currentIndex] = tasks[i];
                currentIndex++;
            }
        }

        return allTasks;
    }   
}

